import React from 'react'
import styled from 'styled-components'
import {PostItem} from './PostItem'

const List = styled.div`
  max-width: 400px;
  margin: 0 auto;
  display: flex;
  flex-direction: column;
  & > *:not(:first-child) {
    margin-top: 20px;
  }
`

export function PostsList() {
  return (
    <List>
      <PostItem key={'1'} name='ResurgentFox' date='14:33' text='Hey bros!' />
      <PostItem key={'2'} name='Booch' date='13:33' text='Murmur!' />
      <PostItem key={'3'} name='Gun_Boy' date='12:15' text='Ya daun! \n Можно пока просто длинную строку вписать и смотреть, сколько строк она займет. Можно пока просто длинную строку вписать и смотреть, сколько строк она займет. Можно пока просто длинную строку вписать и смотреть, сколько строк она займет' />
      <PostItem key={'4'} name='MisterPink' date='11:33' text='Sosite' />
      <PostItem key={'5'} name='loveLinux' date='11:15' text='Windows huinya' />
    </List>
  )
}
